(89555, 226636, 0, 1, 'Ridiculous (Demo)', '當一些具有「時尚指標性」的人物在媒體說出「像你這樣的類型一定要穿這種款式，這種款式在下一季會很流行...」時，你是否無法理解為何他們能預測未來呢？\n事實上，當時尚產業被幾個大集團操控後，他們會決定好「下一季流行元素」讓旗下的數個時尚品牌去執行，並且讓流行成真。這不是預測，只是單純的控制未來、單純的商業。\n「為自己挑選某款式來跟上未來的流行趨勢」豈不是無比荒謬？沒有人會跟上流行趨勢，因為根本沒有這個東西，盲目跟從的消費只會讓公司實際營收追上營業目標而已。\n\nWhen celebrities say “People like you should try these, this style of cloths is going to be a big hit in the following season...”. Have you ever doubted that how do they forecast the trend?\nActually, the fashion industry is controlled by a few enterprises. They decide “the things that are going to be in fashion” and let their brands to make it come true. The style that would be trends has nothing to do with forecast, it is just precisely controlled by the enterprises who have the power.\nIsn''t it ridiculous that “buying something to catch up the fashion trend”? Nobody can catch up the trend, since there is no trend at all. Blindly shopping would only help the turnover achieve the goal their bosses set.', '2014-10-21 00:00:00', 2000, 19, 1, 3, 'V-neck top, \nskinny pants,\nhuge glasses,\nConverse shoes\n\nAdidas t-shirt,\nsagging pants, \nwhite socks,\nNike shoes\n\nYou gonna buy those you belong to\nCause they say you have to \n\nYou gonna wear those you belong to\nCause they are parts of yourselfhood\n\nLook how funny you are\nDon’t you think it is odd\nIt’s a Terrorism \nLet’s get the hell out of Dodge\n\nBlack dress, \nneck lace,\nclutch bag, \nhigh heel shoes\n\nLoose tee,\nbracelet, \npurple legging,\nMary Jane''s shoes\n\nYou gonna buy those you belong to \nCause they say you have to\n\nYou gonna wear those you belong to\nCause they are parts of yourselfhood\n\nLook how funny you are\nDon’t you think it is odd\nIt is a Terrorism\nLet’s get the hell out of Dodge\n\nLook how funny you are\nDon’t you think it is odd\nIt’s a Terrorism\nLet’s get the hell out of Dodge\n\nLook how funny you are\nDon’t you think it is odd\nIt’s a Terrorism\nLet’s get the hell out of Dodge', '', 236, '', '尚霖',